import React from 'react';
import ResultsItem from '../ResultsItem';

function ResultsGroup() {
  return (
    <ul class="list-group">
      <ResultsItem />
      <ResultsItem />
      <ResultsItem />
      <ResultsItem />
    </ul>
  )
}

export default ResultsGroup;
